Ƌ terminalia
. Epandrium separated from tergite 5 by syntergosternite 8, which has 2 spiracles. Tergite 6 and sternite 6 absent. Surstylus absent, i.e. fused to epandrium without trace (
Fig. 328
). Cercal plate large in relation to epandrium, deeply divided ventrally (
Fig. 329
). Hypandrium attached at one point, via an apparent praegonite to lower anterior corner of epandrium. Phallic complex (
Fig. 330
): hypandrium expanded at posterior end as a Vshaped plate connected to base of phallus; praegonite and postgonite present, the latter simple and curved; phallapodeme long but normal in structure, connected to each side of hypandrium by a bridge; phallus long, tubular, simple, juxta large, with a few coarse teeth basally; basal part with a multi-toothed process.
